import "./App.css";
import Profile from "./Profile/Profile";
import { GlobalStyle } from "GlobalStyle";

import users from "../../src/user.json";
import Layout from "./Layout/Layout";
const { username, tag, location, avatar, stats } = users;

function App() {
  return (
    <div>
      <Layout className="App">
        <Profile
          username={username}
          tag={tag}
          location={location}
          avatar={avatar}
          stats={stats}
        />
      </Layout>

      <GlobalStyle />
    </div>
  );
}

export default App;
